import React from 'react';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';
import OwlCarousel from 'react-owl-carousel2';
import sample from './sample.jpg';



const partners = [
  {
    img: 'sample',
    alt: ''
  },
  {
    img: '',
    alt: ''
  },
  {
    img: '',
    alt: ''
  },
  {
    img: '',
    alt: ''
  },
  {
    img: 'sample',
    alt: ''
  }
];

const options = {
  items: 3,
  nav: true,
  rewind: true,
  autoplay: true,
  autoplayTimeout: 3000, // 3 seconds for autoplay
  smartSpeed: 800 // 0.8 seconds for transition speed
};

const PartnersSection = () => {
  return (
    <div className="mx-auto max-w-7xl lg:px-0 px-10 pb-10">
      <div className="flex flex-wrap justify-start items-center -mx-4">
        <div className="w-full md:w-1/2 px-4 mb-4 md:mb-0">
          <h2 className="text-3xl dark:text-white text-primary lg:text-4xl my-6 font-bold lg:py-0">
            Our Partners
          </h2>
        </div>
      </div>

      <OwlCarousel options={options} className="owl-carousel owl-carousel-1 owl-theme mt-5">
        {partners.map((partner, index) => (
          <div key={index} className="item">
            <div className="border-2 rounded-lg border-blue-400 dark:border-black bg-white dark:bg-slate-900 p-4 text-center hover:border-blue-800">
              <img src={partner.img} className="h-28 object-contain" alt={partner.alt} />
            </div>
          </div>
        ))}
      </OwlCarousel>
    </div>
  );
};

export default PartnersSection;
